import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "../styles/ManageStation.css"; // Import CSS

const ManageStations = () => {
  const [stations, setStations] = useState([]);
  const [formData, setFormData] = useState({
    name: "",
    latitude: "",
    longitude: "",
    slots: "",
  });

  const navigate = useNavigate();

  useEffect(() => {
    fetchStations();
  }, []);

  const fetchStations = async () => {
    try {
      const response = await fetch("http://localhost:5006/api/stations");
      const data = await response.json();
      setStations(data);
    } catch (error) {
      console.error("Error fetching stations:", error);
    }
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleAddStation = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch("http://localhost:5006/api/stations", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        fetchStations();
        setFormData({ name: "", latitude: "", longitude: "", slots: "" });
      }
    } catch (error) {
      console.error("Error adding station:", error);
    }
  };

  const handleDelete = async (id) => {
    try {
      await fetch(`http://localhost:5006/api/stations/${id}`, { method: "DELETE" });
      fetchStations();
    } catch (error) {
      console.error("Error deleting station:", error);
    }
  };

  const handleUpdate = (id) => {
    navigate(`/update-station/${id}`);
  };

  return (
    <div className="container">
      <h2 className="heading">Manage Charging Stations</h2>

      <form onSubmit={handleAddStation} className="form">
        <input type="text" name="name" placeholder="Station Name" value={formData.name} onChange={handleChange} required className="input" />
        <input type="number" name="latitude" placeholder="Latitude" value={formData.latitude} onChange={handleChange} required className="input" />
        <input type="number" name="longitude" placeholder="Longitude" value={formData.longitude} onChange={handleChange} required className="input" />
        <input type="number" name="slots" placeholder="Total Slots" value={formData.slots} onChange={handleChange} required className="input" />
        <button type="submit" className="addButton">Add Station</button>
      </form>

      <table className="table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Latitude</th>
            <th>Longitude</th>
            <th>Slots</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {stations.map((station) => (
            <tr key={station._id}>
              <td>{station.name}</td>
              <td>{station.latitude}</td>
              <td>{station.longitude}</td>
              <td>{station.slots}</td>
              <td>
                <button onClick={() => handleUpdate(station._id)} className="updateButton">Update</button>
                <button onClick={() => handleDelete(station._id)} className="deleteButton">Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ManageStations;
